import { useContext } from "react";
import showCard from "./components/store/context";

import Card from "./components/Card/Card";
import Header from "./components/Layout/Header";
import Meals from "./components/Meals/Meals";

const App = () => {
  const cardshown = useContext(showCard);

  return (
    <>
      {cardshown.close && <Card />}
      <Header />
      <main>
        <Meals />
      </main>
    </>
  );
};

export default App;
